import React from "react";
import smileyHappy from "../images/smiley-happy.png";

const SmileyFace = () => {
  //style the img tag

  return (
    <img
      style
      src={smileyHappy}
      alt="Smiley Face"
      style={{
        width: "100px",
        height: "100px",
        borderRadius: "50%",
        backgroundColor: "yellow",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        position: "relative",
      }}
    />
  );
};

export default SmileyFace;
